INSERT INTO `journalarticle` VALUES ('1c1744cc-eb6c-4a4e-8b88-9728694e4e32',20639,20640,20182,20155,20159,'','2017-01-26 14:54:57','2017-01-26 14:54:57',0,0,0,'/0/','WELCOME',1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Welcome</Title></root>','welcome','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<dynamic-element name=\"content\" type=\"text_area\" index-type=\"keyword\" index=\"0\">\n		<dynamic-content language-id=\"en_US\"><![CDATA[\n			\n				<style type=\"text/css\">\n					h2.welcome-title {\n						font-size: 35px;\n						margin: 0 0 40px;\n					}\n\n					h4.subtitle {\n						font-size: 24px;\n						line-height: 30px;\n						margin-bottom: 0;\n					}\n\n					.welcome-content {\n						font-size: 15px;\n						margin: 0;\n					}\n\n					.welcome-content a {\n						text-decoration: none;\n					}\n\n					.welcome-content a:hover {\n						text-decoration: underline;\n					}\n\n					.welcome-content .welcome-text {\n						line-height: 22px;\n						margin: 0;\n					}\n\n					.welcome-content .pdf {\n						display: inline-block;\n						margin-top: 25px;\n					}\n\n					.welcome-content .welcome-icon {\n						float: left;\n						margin: 4px 0;\n						padding-right: 38px;\n					}\n\n					@media all and (max-width: 767px) {\n						h2.welcome-title {\n							font-size: 24px;\n						}\n\n						h4.subtitle {\n							margin: 32px 0 4px;\n						}\n\n						.welcome-content-wrapper {\n							text-align: center;\n						}\n\n						.welcome-content .welcome-icon {\n							float: none;\n							padding: 0;\n						}\n					}\n				</style>\n\n				<div class=\"welcome-content-wrapper\">\n					<h2 class=\"welcome-title\">\n						Welcome To Liferay Portal\n					</h2>\n\n					<div class=\"welcome-content\">\n						<img class=\"welcome-icon\" src=\"/documents/20182/0/welcome_cube/407ca591-ada3-45aa-95b6-363b8cdd5344?version=1.0&t=1485442495442\" />\n\n						<h4 class=\"subtitle\">\n							Start\n						</h4>\n\n						<p class=\"welcome-text\">\n							Review our <a href=\"http://www.liferay.com/welcome-start?v1.0\" target=\"_blank\">Quick Start Guide</a> for an overview of Liferay\'s features.\n						</p>\n\n						<div class=\"helper-clearfix\">&nbsp;</div>\n					</div>\n\n					<div class=\"welcome-content\">\n						<img class=\"welcome-icon\" src=\"/documents/20182/0/welcome_learn/04475928-60f1-4eee-9ca1-25c85d5187a5?version=1.0&t=1485442496002\" />\n\n						<h4 class=\"subtitle\">\n							Learn\n						</h4>\n\n						<p class=\"welcome-text\">\n							Read the official <a href=\"http://www.liferay.com/welcome-learn?v1.0\" target=\"_blank\">Liferay User Guide</a> for detailed information about setting up and configuring Liferay.\n						</p>\n\n						<div class=\"helper-clearfix\">&nbsp;</div>\n					</div>\n\n					<div class=\"welcome-content\">\n						<img class=\"welcome-icon\" src=\"/documents/20182/0/welcome_community/62181525-80ec-480c-ba30-eb808723695c?version=1.0&t=1485442495901\" />\n\n						<h4 class=\"subtitle\">\n							Engage\n						</h4>\n\n						<p class=\"welcome-text\">\n							Visit the <a href=\"http://www.liferay.com/welcome-engage?v1.0\" target=\"_blank\">Liferay Community</a> to post questions, find answers, and contribute.\n						</p>\n\n						<div class=\"helper-clearfix\">&nbsp;</div>\n					</div>\n\n					<div class=\"welcome-content\">\n						<img class=\"welcome-icon\" src=\"/documents/20182/0/welcome_tools/3cbac07e-8bbb-47b3-bb5d-a4b325661768?version=1.0&t=1485442496163\" />\n\n						<h4 class=\"subtitle\">\n							Develop\n						</h4>\n\n						<p class=\"welcome-text\">\n							Explore our <a href=\"http://www.liferay.com/welcome-develop?v1.0\" target=\"_blank\">Developer Resources</a> to develop apps and more for Liferay Portal.\n						</p>\n\n						<div class=\"helper-clearfix\">&nbsp;</div>\n					</div>\n\n					<div class=\"welcome-content\">\n						<img class=\"welcome-icon\" src=\"/documents/20182/0/welcome_ee/c9d39cf1-d730-4554-a760-bd96f6507e26?version=1.0&t=1485442495823\" />\n\n						<h4 class=\"subtitle\">\n							Evaluate\n						</h4>\n\n						<p class=\"welcome-text\">\n							Learn more about partners, support, training and other <a href=\"http://www.liferay.com/welcome-evaluate?v1.0\" target=\"_blank\">enterprise level options</a> available for Liferay.\n						</p>\n\n						<a class=\"pdf\" href=\"/documents/20182/0/helpful_links_for_using_liferay_portal/076228b5-de24-4271-9b06-3ca14eb1dfd6?version=1.0\">Download this page as a PDF</a>\n					</div>\n				</div>\n			\n		]]></dynamic-content>\n	</dynamic-element>\n</root>','general','BASIC-WEB-CONTENT-6.2.3.1','BASIC-WEB-CONTENT-6.2.3.1','','2010-02-01 00:00:00',NULL,NULL,1,0,20641,'',0,20159,'','2017-01-26 14:54:58'),('8653905c-fe22-46ff-b408-90dde6e2e40c',32407,32408,20182,20155,20707,'Alejandro Del Rio','2017-04-05 19:22:52','2017-04-05 19:22:52',0,0,0,'/0/','32406',1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"es_ES\" default-locale=\"es_ES\"><Title language-id=\"es_ES\">footer</Title></root>','footer','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"es_ES\" default-locale=\"es_ES\">\n	<dynamic-element name=\"content\" type=\"text_area\" index-type=\"keyword\" index=\"0\">\n		<dynamic-content language-id=\"es_ES\"><![CDATA[<p style=\"text-align: center;\">RunTracker</p>]]></dynamic-content>\n	</dynamic-element>\n</root>','general','BASIC-WEB-CONTENT-6.2.3.1','BASIC-WEB-CONTENT-6.2.3.1','','2017-04-05 19:20:00',NULL,NULL,0,0,32409,'',0,20707,'Alejandro Del Rio','2017-04-05 19:22:52'),('de82e5d0-6f03-4d52-9f26-7c19b86b1f7e',32420,32421,20182,20155,20707,'Alejandro Del Rio','2017-04-05 19:25:24','2017-04-05 19:25:24',0,0,0,'/0/','32419',1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"es_ES\" default-locale=\"es_ES\"><Title language-id=\"es_ES\">footer</Title></root>','foot-1','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"es_ES\"